import React, { Component } from "react";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from "react-responsive-carousel";
import Button from "@material-ui/core/Button";
import "./style.css";
export default class OnBoarding extends Component {
  constructor(props) {
    super(props);
    console.log("props :", this.props);
  }
  render() {
    return (
      <div>
        <img src={require("public/images/logo.svg")} alt="" />
        <Carousel
          showArrows={false}
          showThumbs={false}
          showIndicators={false}
          showStatus={false}
          className="carousel-wrapper"
        >
          <div>
            <img src="https://img.freepik.com/free-vector/lovely-welcome-composition-with-flat-design_23-2147920507.jpg?size=338&ext=jpg" />
          </div>
          <div>
            <img src="https://img.freepik.com/free-vector/lovely-welcome-composition-with-flat-design_23-2147920507.jpg?size=338&ext=jpg" />
          </div>
          <div>
            <img src="https://img.freepik.com/free-vector/lovely-welcome-composition-with-flat-design_23-2147920507.jpg?size=338&ext=jpg" />
            <Button
              variant="outlined"
              color="primary"
              onClick={() => this.props.changeCurrentPage("preference")}
            >
              Next
            </Button>
          </div>
        </Carousel>
      </div>
    );
  }
}
